import React, { Component } from 'react';




class EventPractice extends Component {
    state = {
       message: ''
    }
    render() {
        return (
            <div>
               <h1>이벤트 연습</h1>  
               <input
                type='text'
                name='message'
                placeholder='아무거나 입력해보세요'
                value={this.state.messages}
                onChange={
                    (e) => {
                          this.setState({
                              message: e.target.value
                          })
                    }
                }/>
            </div>
        );
    }
}

export default EventPractice;
